import React, { Fragment } from 'react';
import { Typography } from '@material-ui/core';

const TopDashBoard = props => {
    return (
        <Fragment>
            <Typography variant='h3' color='textPrimary'>Good morning, Shen Fen</Typography>
            <Typography variant='h6'>Here's what's happening</Typography>
        </Fragment>
    );
};
export default TopDashBoard;
